import axios from 'axios';

const EMPLOYEE_API_BASE_URL = 'http://localhost:8081/api/products';

class ProductService {
    getProducts() {
        return axios.get(EMPLOYEE_API_BASE_URL)
    }
}


export default new ProductService();
